import React from "react";

const List = ({ people }) => {
  return (
    <>
      {people.map((person) => {
       return <article key={person.id}>
          <img src={person.image} alt={person.name} />
          <div>
            <h4>{person.name}</h4>
            <h5>{person.age} years</h5>
          </div>
        </article>;
      })}
    </>
  );
};

export default List;
